            "6 Cependant, alors qu'il savait Lazare malade, il demeura deux jours encore à l'endroit où il se trouvait. Après quoi seulement, il dit aux disciples: \"Retournons en Judée.\" Les disciples lui dirent: \"Rabbi, tout récemment encore les Juifs cherchaient à te lapider; et tu veux retourner là-bas?\"",
